<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
</head>
<body>
<script>
    let a = [7, 2, 5, 3, 5, 3];
    let b = [7, 2, 5, 4, 6, 3, 5, 3];
    let arr = [];
    let check;
    for (let i = 0; i < b.length; i++) {
        check = true;
        for (let j = 0; j < a.length; j++) {
            if (b[i] === a[j]) {
                check = false;
                break;
            }
        }
        if (check) {
            arr.push(b[i]);
        }
    }
    console.log(arr);
</script>
</body>
</html>
